import React from 'react';
import './App.css';

function Search() {
  return (
    <input
      className="search"
      placeholder="https://github.com/stripe"
    ></input>
  );
}

function App() {
  return (
    <div className="App">
      <nav className="App-nav">
        <div>Git Scrape</div>
        <div>View on Github</div>
      </nav>
      <div className="content">
        <Search />
      </div>
    </div>
  );
}

export default App;
